import React from 'react'
import { Icon } from "antd";
import "./styles.css";

import { connect } from 'react-redux';  //connect toi store
import { fetchTaskRequest } from '../../../actions/index';
import styles from './styles';
import ContentTittle from '../../TemplateComponents/ContentTittle/index';

const leftContentArray = [
    { tittle: 'Tin mới nhất', updateAt: 'Ngày 11 tháng 08 năm 2020', img: 'https://gifimage.net/wp-content/uploads/2017/10/new-animated-gif-12.gif' },
    { tittle: 'Tin tức - Sự kiện', updateAt: 'Ngày 11 tháng 08 năm 2020', img: 'https://gifimage.net/wp-content/uploads/2017/10/new-animated-gif-12.gif' },
    { tittle: 'Văn bản hướng dẫn', updateAt: 'Ngày 11 tháng 08 năm 2020', img: 'https://gifimage.net/wp-content/uploads/2017/10/new-animated-gif-12.gif' },
]

const leftContents = leftContentArray.map((x, index) =>
    <div className="left-content">
        <div className="header-content">
            Tin mới nhất
    </div>
        <div className="CardVideo">
            <div className="main-content">
                <div className="main-content1">
                    <div>
                        <img src="https://gifimage.net/wp-content/uploads/2017/10/new-animated-gif-12.gif" width="135px" height="100px"></img>
                    </div>
                    <div className="firstContent">
                        <a>TP Hồ Chí Minh vững vàng ngôi đầu tại Hội khỏe Phù Đổng toàn quốc</a>
                        <span className="updateTitle">Ngày đăng: <span className="updateAt">Ngày 11 tháng 08 năm 2020</span></span>
                    </div>
                </div>
                <div className="body-content">
                    <div className="body-content-row">
                        <Icon style={{ color: '#F38032' }} type="caret-right" />
                        <a>TP Hồ Chí Minh vững vàng ngôi đầu tại Hội khỏe Phù Đổng toàn quốc</a>
                        <span className="updateTitle">Ngày đăng: <span className="updateAt">Ngày 11 tháng 08 năm 2020</span></span>
                    </div>
                </div>
            </div>
            <div className="footer-content">
                <a>Xem thêm</a>
            </div>
        </div>
    </div>
)

class DashBoard extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            tasks: []
        }
    }

    componentDidMount() {
        this.props.fetchTaskRequest();
    }

    render() {
        const { tasks } = this.props
        console.log('tasks', tasks)
        return (
            <div>
                < ContentTittle />
                <div className="left-content">
                    <div className="header-content">
                        Tin mới nhất
                    </div>
                    <div className="CardVideo">
                        <div className="main-content">
                            <div className="main-content1">
                                <div>
                                    <img src="https://gifimage.net/wp-content/uploads/2017/10/new-animated-gif-12.gif" width="135px" height="100px"></img>
                                </div>
                                <div className="firstContent">
                                    <a>TP Hồ Chí Minh vững vàng ngôi đầu tại Hội khỏe Phù Đổng toàn quốc</a>
                                    <span className="updateTitle">Ngày đăng: <span className="updateAt">Ngày 11 tháng 08 năm 2020</span></span>
                                </div>
                            </div>
                            <div className="body-content">
                                <div className="body-content-row">
                                    <Icon style={{ color: '#F38032' }} type="caret-right" />
                                    <a>TP Hồ Chí Minh vững vàng ngôi đầu tại Hội khỏe Phù Đổng toàn quốc</a>
                                    <span className="updateTitle">Ngày đăng: <span className="updateAt">Ngày 11 tháng 08 năm 2020</span></span>
                                </div>
                            </div>
                        </div>
                        <div className="footer-content">
                            <a>Xem thêm</a>
                        </div>
                    </div>
                </div>
            </div>
        )
    }
}

// lay tat ca du lieu task tu store
const mapStateToProps = (state) => {
    return {
        tasks: state.vidu1Reducer
    }
}

// luu du lieu len store
const mapDispatchToProps = (dispatch) => {
    return {
        fetchTaskRequest: (tasks) => {
            dispatch(fetchTaskRequest(tasks));
        }
    }
}

export default connect(mapStateToProps, mapDispatchToProps)(DashBoard);
